import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginPage from "./Pages/LoginPage";
import LandingPage from "./Pages/LandingPage";
import CreateSpecialization from "./Pages/CreateSpecialization";
import ReadSpecialization from "./Pages/ReadSpecialization";
import UpdateSpecialization from "./Pages/UpdateSpecialization";
import DeleteSpecialization from "./Pages/DeleteSpecialization";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="/landing" element={<LandingPage />} />
        <Route path="/create-specialization" element={<CreateSpecialization />} />
        <Route path="/read-specialization" element={<ReadSpecialization />} />
        <Route path="/update-specialization" element={<UpdateSpecialization />} />
        <Route path="/delete-specialization" element={<DeleteSpecialization />} />
      </Routes>
    </Router>
  );
}

export default App;
